import React from 'react';
import Items from './Items';

class ResultBody extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            todos: {}
        };
        this.getTodos = this.getTodos.bind(this)
    }

    componentDidMount() {
        <Items/>
    }

    getTodos(todosParam) {
        console.log(Object.values(todosParam))
        this.setState((state) => ({
            todos: todosParam
        }))
    }

    render() {
        const {todos} = this.state;
        return (
            <div className='body'>
                <div className='body-inside'>
                    <Items />
                    {console.log(Object.values(todos))}
                    <div className='body-bottom'>
                        <div className='text'>5 items left</div>
                        <div className='text tabs'>
                            <div className='tab active'> All </div>
                            <div className='tab'> Active </div>
                            <div className='tab'> Completed </div>
                        </div>
                        <div className='text clear-completed'>Clear Completed</div>
                    </div>
                    <div className='body-bottom-mobile'>
                        <div className='text tabs'>
                            <div className='tab active'> All </div>
                            <div className='tab'> Active </div>
                            <div className='tab'> Completed </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default ResultBody;
